class Item {
  String japanese;
  String translation;
  String strokeOrder;
  final String? kanjiVGCode;
  String itemType; // 'Kanji' or 'Vocab'
  String reading; // Used when itemType is 'Vocab'
  String onYomi; // On'yomi reading
  String kunYomi; // Kun'yomi reading
  String naNori; // Nanori reading
  List<String> tags; // Tags for categorization
  String notes; // User notes for the item
  bool isStarred; // Whether the item is starred

  Item({
    required this.japanese,
    required this.translation,
    this.strokeOrder = '',
    this.kanjiVGCode,
    this.itemType = 'Kanji',
    this.reading = '',
    String? onYomi,
    String? kunYomi,
    String? naNori,
    this.tags = const [],
    this.notes = '',
    this.isStarred = false,
  })  : onYomi = onYomi ?? '',
        kunYomi = kunYomi ?? '',
        naNori = naNori ?? '';
}

class ItemSet {
  String name;
  final List<Item> items;
  List<String> tags;
  bool displayInDictionary;
  String setType;
  bool displayInWritingArcade;
  bool displayInReadingArcade;

  ItemSet({
    required this.name,
    required this.items,
    this.tags = const [],
    this.displayInDictionary = true,
    this.setType = 'Uncategorised',
    this.displayInWritingArcade = true,
    this.displayInReadingArcade = true,
  });
}

