// Create immutable default presets by combining manual presets with copies from setsData
Map<String, ItemSet> _createAllDefaultPresets() {
  // Start with manually created presets (Hiragana and Katakana)
  final Map<String, ItemSet> allPresets = Map.from(defaultPresets);
  
  // Add immutable copies of other presets from setsData
  final presetNames = [
    'Essential Radicals',
    'JLPT N5 Kanji',
    'JLPT N4 Kanji',
    'JLPT N3 Kanji',
    'JLPT N2 Kanji',
  ];
  
  for (final name in presetNames) {
    if (setsData.containsKey(name)) {
      final original = setsData[name]!;
      allPresets[name] = ItemSet(
        name: original.name,
        tags: List.unmodifiable(original.tags),
        setType: original.setType,
        displayInDictionary: original.displayInDictionary,
        displayInWritingArcade: original.displayInWritingArcade,
        displayInReadingArcade: original.displayInReadingArcade,
        items: List.unmodifiable(original.items.map((item) => Item(
          japanese: item.japanese,
          translation: item.translation,
          strokeOrder: item.strokeOrder,
          kanjiVGCode: item.kanjiVGCode,
          itemType: item.itemType,
          reading: item.reading,
          tags: item.tags,
          notes: item.notes,
        )).toList()),
      );
    }
  }
  
  return allPresets;
}

// Complete default presets (includes Hiragana, Katakana, Essential Radicals, JLPT N5-N2)
final Map<String, ItemSet> completeDefaultPresets = _createAllDefaultPresets();

// Static lookup map for stroke order data - built once at initialization
final Map<String, Map<String, String?>> _originalItemData = {};

// Initialize the lookup map with original data
void _initializeItemDataLookup() {
  if (_originalItemData.isEmpty) {
    for (var set in setsData.values) {
      for (var item in set.items) {
        if (!_originalItemData.containsKey(item.japanese)) {
          _originalItemData[item.japanese] = {
            'strokeOrder': item.strokeOrder,
            'kanjiVGCode': item.kanjiVGCode,
          };
        }
      }
    }
  }
}

// Lookup function to find strokeOrder and kanjiVGCode for any character
Map<String, String?>? lookupItemData(String character) {
  _initializeItemDataLookup();
  return _originalItemData[character];
}









